import React from 'react';
import {  Link } from "react-router-dom";
import "./App.css"


const Navbar= () =>{
  return (
  <section className='navigation'>
    <Link to="/"><h1 id="appName">Give Good</h1></Link>
    <Link to="/createAccount" id="SignupBox"><h3>Sign up</h3></Link>


  </section>
  );
}
export default Navbar;
